import React from "react";

function Header() {
  return (
    <div>
      <nav>
        <div className="nav-wrapper">
          <a href="/" className="left">
            CartoonNetwork
          </a>
          <ul className="center">
             <li>Click an image to begin!</li>
          </ul>
          <div className="right">
             <span>Guessed correctly: </span>| <span>Top Score: </span>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Header;
